import React from 'react';
import MenuItem from '../menu-items/menu-items.componenta';
import './directory.style.scss';



class Directory extends React.Component{
    constructor () {
  super();
 
  this.state = {
      sections :[
          {
            title: 'HATS',
            imageSrc : 'hats.png',
            id: 1,
            linkUrl: 'hats'
        },
      
        {
            title: 'JACKETS',
            imageSrc: 'jackets.png',
            id: 2,
            linkUrl: 'jackets'

        },

         {
            title: 'SNEAKERS',
            imageSrc : 'sneakers.png' ,
            id: 3,
            linkUrl: 'sneakers'
        },
         
        {
            title: 'MENs',
            imageSrc : 'men.png' ,
            size:'large',
            id: 4,
            linkUrl: 'mens'
        },
         
         {
            title: 'WOMENs',
            imageSrc : 'womens.png',
            size:'large',
            id: 5,
            linkUrl: 'womens'
        }
        ] 
       }

 }
 render(){
     return(
        <div className ='directory-menu'>
            {
                this.state.sections.map(({ id, ...otherSectionProps}) => (
                <MenuItem key={id} {...otherSectionProps}/>
            
            ))}
        </div>
     )
 }

}
export default Directory;
